import React from "react";
import PlaceList from "../Components/PlaceList";
import { useParams } from "react-router-dom/cjs/react-router-dom.min";

const Dummy_places = [
    {
        id:'p1',
        title:'Empire state Building',
        description:'Tallest Building',
        imageUrl:'https://www.kitano.com/resourcefiles/snippet-main-img/empire-state-building-in-new-york-top.jpg?version=8242023115716',
        address:'20 W 34th St., New York, NY 10001',
        location:{
            lat:'40.748492',
            log:'-73.985699',
        },
        creatorId:'u1',

    },
    {
        id:'p2',
        title:'Empire state Building',
        description:'Tallest Building',
        imageUrl:'https://www.kitano.com/resourcefiles/snippet-main-img/empire-state-building-in-new-york-top.jpg?version=8242023115716',
        address:'20 W 34th St., New York, NY 10001',
        location:{
            lat:'40.748492',
            log:'-73.985699',
        },
        creatorId:'u2',

    },
]

const UserPlaces = props => {
    const captureurl = useParams().UserId;
    const filtered_list = Dummy_places.filter(places => places.creatorId === captureurl)
    return <PlaceList items={filtered_list} />
};

export default UserPlaces;
